import React from "react";
import { Card, CardContent, Typography } from "@mui/material";

const WeatherCard = ({ weather }) => {
  if (!typeof(weather) === "array") {
    return (
      <div>
        {console.log(weather)}
        <Card sx={{ minWidth: 275 }}>
          <CardContent>
            <Typography
              sx={{ fontSize: 14 }}
              color="text.secondary"
              gutterBottom
            >
              {weather.city.name}
            </Typography>
            <Typography variant="h5" component="div"></Typography>
            {/* <Typography variant="body2">{weather.list[0].main.temp}</Typography> */}
            <img src=""></img>
          </CardContent>
        </Card>
      </div>
    );
  }
};

export default WeatherCard;
